// Code to reveal my contact email
const EMAIL_BASE64 = `data:image/jpeg;base64,`;

const showEmailButton = document.querySelector('#show-email');

function revealEmail () {
    const emailImg = document.querySelector('#contact-email-img-tag');
    emailImg.src = EMAIL_BASE64;
    emailImg.classList.remove('opacity-0');
    emailImg.classList.add('opacity-100');
    console.log('email revealed!');
    return true;
}
showEmailButton.addEventListener('click', revealEmail, { once: true });